.input-container {
    position: relative;
    display: flex;
    height: 32px;
    width: 100%;
    &.flat {
        height: 40px;
        .input {
            flex-grow: 1;
            border: none;
            border-bottom: 2px solid #0052cc;
            font-size: 21px;
            background: #fff;
            &::placeholder {
                @apply text-textLight;
                font-size: 21px;
            }
            &:focus,
            &:hover {
                border: none;
                border-bottom: 2px solid #0052cc;
                box-shadow: none;
                background: #fff;
                outline: 0;
            }
        }
    }
}

.invalid {
    &,
    &:focus {
        border: 1px solid #e13c3c;
        box-shadow: none;
    }
}

.input-icon-container {
    position: absolute;
    height: 100%;
    left: 0;
    top: 0;
    bottom: 0;
    display: flex;
    align-items: center;
    justify-content: center;
    &.right {
        left: auto;
        right: 0;
        cursor: pointer;
    }
}

